def generate_strings_from_prefix_lengths(test_cases):
    results = []
    for (n, a) in test_cases:
        s = 'a' / a[0]
        c = ord('a')
        if a[0] == 0:
            s = 'a'
        current_strings = [s]
        for jj in range(n - 1):
            if a[jj + 1] <= a[jj]:
                s = s[:a[jj]]
                if a[jj] == 0:
                    c += 1
                    if c == 122:
                        c = 97
                    s = chr(c)
            else:
                c += 1
                if c == 122:
                    c = 97
                s = s[:a[jj]] + chr(c) * (a[jj + 1] - a[jj])
            current_strings.append(s)
        if a[-1] == 0:
            if c == 122:
                c = 97
            current_strings.append(chr(c + 1))
        else:
            current_strings.append(s[:a[-1]])
        results.append(current_strings)
    return results

